myApp.factory("todoService",["$http","baseUrl",function(t,o){return{get_todos:function(){return t({method:"GET",dataType:"JSONP",url:o.url+"/todos",headers:{"Content-Type":"application/x-www-form-urlencoded"}})},get_todo:function(e){return t({method:"GET",dataType:"JSONP",url:o.url+"/todos/"+e,headers:{"Content-Type":"application/x-www-form-urlencoded"}})},post_todo:function(e){return t({method:"POST",dataType:"JSONP",url:o.url+"/todos",headers:{"Content-Type":"application/x-www-form-urlencoded"},data:$.param(e)})},put_todo:function(e,r){return t({method:"PATCH",dataType:"JSONP",url:o.url+"/todos/"+e,headers:{"Content-Type":"application/x-www-form-urlencoded"},data:$.param(r)})},delete_todo:function(e){return t({method:"DELETE",dataType:"JSONP",url:o.url+"/todos/"+e,headers:{"Content-Type":"application/x-www-form-urlencoded"}})}}}]);